import { useState } from "react";
import { useNavigate } from "react-router-dom";

export function SearchClimber(){
    const [searchID, setSearchID] = useState();
    const navigate = useNavigate();

    function handleSubmit(e){
      e.preventDefault()
      const link = "SearchClimber/"+searchID
      setSearchID("")
      navigate(
        '/'
      )
    }

     return (
    
        <form onSubmit={handleSubmit} className="new-climber-form">
          <div className="form-row">
            <label>ID: </label>
            <input
              value={searchID}
              onChange={e => setSearchID(e.target.value)}
              type="number"
              id="climberID"
            required />
          </div>
          <button className="searchClimer">Search</button>
        </form>
        
      )
}
